import styles from "./Header.module.css"

export default function Header(username, onLogout) {
    return (
        <div>
            <h1>Tom's Task Tracker</h1>
            <h4>Welcome back {username}! </h4>
            <button onClick={onLogout}>Logout</button>
        </div>
    )
}
